import Link from 'next/link';
import styled from 'styled-components';

const StyledNav = styled.nav`

`;

const Header = () => (
  <StyledNav>
    <Link href="/">
      <a>Home</a>
    </Link>
    <Link href="/login">
      <a>Login</a>
    </Link>
    <Link href="/signup">
      <a>Signup</a>
    </Link>
  </StyledNav>
);

export default Header;
